import React from "react";
import { Link } from 'react-router-dom'
import './index.css'
import logo from '../../assets/images/timgg.png'

import { Menu, Button } from 'antd';
import {
    AppstoreOutlined,
    MenuUnfoldOutlined,
    MenuFoldOutlined,
    PieChartOutlined,
    DesktopOutlined,
    ContainerOutlined,
    MailOutlined,
} from '@ant-design/icons';
const { SubMenu } = Menu;


export default class LeftNav extends React.Component{
    render() {
        return (
            <Link to='/admin' className='left-nav'>
                <header className='left-nav-header'>
                    <img src={logo} alt=""/>
                    <h1>硅谷后台</h1>
                </header>
            </Link>
        );
    }
}
